  <Layout>
    <div className="cart-page">
      <span className="cart-title">Shopping Cart</span>
      <div className="cart-list">
        <CartItem /> 
        <CartItem /> 
        <CartItem /> 
        <CartItem /> 
      </div>
      <div className="cart-total">
        Toatl: 
        <span className="total-price">$200</span>
      </div>
    </div>
  </Layout>
);

export default Cart;
